sts;\r\n\r\npublic class AuctionServiceTests\r\n{\r\n    private readonly IUnitOfWork _unitOfWorkMock;\r\n    private readonly IMapper _mapperMock;\r\n    private readonly AuctionService _auctionService;\r\n\r\n    public AuctionServiceTests()\r\n    {\r\n        _unitOfWorkMock = Substitute.For\u003CIUnitOfWork\u003E();\r\n        _mapperMock = Substitute.For\u003CIMapper\u003E();\r\n        _auctionService = new AuctionService(_unitOfWorkMock, _mapperMock);\r\n    }\r\n\r\n    public class BetMethod : AuctionServiceTests\r\n    {\r\n        [Fact]\r\n        public void Bet_PassingIdLessThanZero_ThrowsInvalidIdException()\r\n        {\r\n            // Arrange\r\n            int id = -1;\r\n            string customerName = \u0022Test Customer\u0022;\r\n            int bid = 100;\r\n\r\n            // Act \u0026 Assert\r\n            Assert.Throws\u003CInvalidIdException\u003E(() =\u003E _auctionService.Bet(id, customerName, bid));\r\n        }\r\n\r\n        [Fact]\r\n        public void Bet_PassingNullCustomerName_ThrowsInvalidNameException()\r\n        {\r\n            // Arrange\r\n            int id = 1;\r\n            string customerName = null;\r\n            int bid = 100;\r\n\r\n            // Act \u0026 Assert\r\n            Assert.Throws\u003CInvalidNameException\u003E(() =\u003E _auctionService.Bet(id, customerName, bid));\r\n        }\r\n\r\n        [Fact]\r\n        public void Bet_PassingNonExistentAuctionId_ThrowsInvalidIdException()\r\n        {\r\n            // Arrange\r\n            int id = 1;\r\n            string customerName = \u0022Test Customer\u0022;\r\n            int bid = 100;\r\n            _unitOfWorkMock.Auctions.Get(id).Returns((Auction)null);\r\n\r\n            // Act \u0026 Assert\r\n            Assert.Throws\u003CInvalidIdException\u003E(() =\u003E _auctionService.Bet(id, customerName, bid));\r\n        }\r\n\r\n        [Fact]\r\n        public void Bet_AuctionNotStarted_ThrowsInvalidAuctionExceptionWithCorrectMessage()\r\n / Act \u0026 Assert\r\n        var exception = Assert.Throws\u003CInvalidOperationException\u003E(() =\u003E LUPDecomposition.Decompose(singularMatrix, out _, out _, out _));\r\n        Assert.Equal(\u0022\u041C\u0430\u0442\u0440\u0438\u0446\u044F \u0454 \u0432\u0438\u0440\u043E\u0434\u0436\u0435\u043D\u043E\u044E.\u0022, exception.Message);\r\n    }\r\n\r\n    [Fact]\r\n    public void Decompose_PassingValid2x2Matrix_ReturnsCorrectLUP()\r\n    {\r\n        // Arrange\r\n        double[,] matrix = new double[,]\r\n        {\r\n            { 2, 1 },\r\n            { 1, 2 }\r\n        };\r\n\r\n        // Act\r\n        LUPDecomposition.Decompose(matrix, out double[,] L, out double[,] U, out int[] P);\r\n\r\n        // Assert\r\n        Assert.Equal(2, L.GetLength(0));\r\n        Assert.Equal(2, L.GetLength(1));\r\n        Assert.Equal(2, U.GetLength(0));\r\n        Assert.Equal(2, U.GetLength(1));\r\n        Assert.Equal(2, P.Length);\r\n\r\n        // Expected L for this permutation (identity)\r\n        Assert.Equal(1, L[0, 0]);\r\n        Assert.Equal(0, L[0, 1]);\r\n        Assert.Equal(0.5, L[1, 0]);\r\n        Assert.Equal(1, L[1, 1]);\r\n\r\n        // Expected U for this permutation\r\n        Assert.Equal(2, U[0, 0]);\r\n        Assert.Equal(1, U[0, 1]);\r\n        Assert.Equal(0, U[1, 0]);\r\n        Assert.Equal(1.5, U[1, 1]);\r\n\r\n        // Expected permutation (identity)\r\n        Assert.Equal(0, P[0]);\r\n        Assert.Equal(1, P[1]);\r\n    }\r\n\r\n    [Fact]\r\n    public void Decompose_PassingValid3x3Matrix_ReturnsCorrectLUP()\r\n    {\r\n        // Arrange\r\n        double[,] matrix = new double[,]\r\n        {\r\n            { 1, 2, 3 },\r\n            { 4, 5, 6 },\r\n            { 7, 8, 9 }\r\n        };\r\n\r\n        // Act\r\n        LUPDecomposition.Decompose(matrix, out double[,] L, out double[,] U, out int[] P);\r\n\r\n        // Assert\r\n        Assert.Equal(3, L.GetLength(0));\r\n        Assert.Equal(3, L.GetLength(1));\r\n        Assert.Equal(3, U.GetLength(0));\r\n        Assert.Equal(3, U.GetLength(1));\r\n        Assert.Equal(3, P.Length);\r\n\r\n        // Verify L is unit lower triangular\r\n        Assert.Equal(1, L[0, 0]);\r\n        Assert.Equal(0, L[0, 1]);\r\n        Assert.Equal(0, L[0, 2]);\r\n        Assert.Equal(4.0 / 7.0, L[1, 0]);\r\n        Assert.Equal(1, L[1, 1]);\r\n        Assert.Equal(0, L[1, 2]);\r\n        Assert.Equal(1.0 / 7.0, L[2, 0]);\r\n        Assert.Equal(2.0 / 3.0, L[2, 1]);\r\n        Assert.Equal(1, L[2, 2]);\r\n\r\n        // Verify U is upper triangular\r\n        Assert.Equal(7, U[0, 0]);\r\n        Assert.Equal(8, U[0, 1]);\r\n        Assert.Equal(9, U[0, 2]);\r\n        Assert.Equal(0, U[1, 0]);\r\n        Assert.Equal(-6.0 / 7.0, U[1, 1]);\r\n        Assert.Equal(-12.0 / 7.0, U[1, 2]);\r\n        Assert.Equal(0, U[2, 0]);\r\n        Assert.Equal(0, U[2, 1]);\r\n        Assert.Equal(0, U[2, 2]);\r\n\r\n        // Verify permutation\r\n        Assert.Equal(2, P[0]);\r\n        Assert.Equal(1, P[1]);\r\n        Assert.Equal(0, P[2]);\r\n    }\r\n\r\n    [Fact]\r\n    public void Decompose_PassingMatrixRequiringRowSwap_ReturnsCorrectLUP()\r\n    {\r\n        // Arrange\r\n        double[,] matrix = new double[,]\r\n        {\r\n            { 0, 0, 0 },\r\n            { 0, 0, 1 },\r\n            { 0, 1, 0 }\r\n        };\r\n\r\n        // Act\r\n        LUPDecomposition.Decompose(matrix, out double[,] L, out double[,] U, out int[] P);\r\n\r\n        // Assert\r\n        Assert.Equal(3, L.GetLength(0));\r\n        Assert.Equal(3, L.GetLength(1));\r\n        Assert.Equal(3, U.GetLength(0));\r\n        Assert.Equal(3, U.GetLength(1));\r\n        Assert.Equal(3, P.Length);\r\n\r\n        // Expected L (identity after permutation)\r\n        Assert.Equal(1, L[0, 0]);\r\n        Assert.Equal(0, L[0, 1]);\r\n        Assert.Equal(0, L[0, 2]);\r\n        Assert.Equal(0, L[1, 0]);\r\n        Assert.Equal(1, L[1, 1]);\r\n        Assert.Equal(0, L[1, 2]);\r\n        Assert.Equal(0, L[2, 0]);\r\n        Assert.Equal(1, L[2, 1]);\r\n        Assert.Equal(1, L[2, 2]);\r\n\r\n        // Expected U (swapped rows)\r\n        Assert.Equal(0, U[0, 0]);\r\n        Assert.Equal(1, U[0, 1]);\r\n        Assert.Equal(0, U[0, 2]);\r\n        Assert.Equal(0, U[1, 0]);\r\n        Assert.Equal(0, U[1, 1]);\r\n        Assert.Equal(1, U[1, 2]);\r\n        Assert.Equal(0, U[2, 0]);\r\n        Assert.Equal(0, U[2, 1]);\r\n        Assert.Equal(0, U[2, 2]);\r\n\r\n        // Expected permutation (swapped rows 1 and 2)\r\n        Assert.Equal(0, P[0]);\r\n        Assert.Equal(2, P[1]);\r\n        Assert.Equal(1, P[2]);\r\n    }\r\n\r\n    [Theory]\r\n    [InlineData(0, 0)]\r\n    [InlineData(1, 1)]\r\n    [InlineData(2, 2)]\r\n    [InlineData(3, 3)]\r\n    [InlineData(4, 4)]\r\n    public void GetMatrix_PassingSquareMatrix_ReturnsCorrectStringRepresentation(int size, int n)\r\n    {\r\n        // Arrange\r\n        double[,] matrix = new double[n, n];\r\n        for (int i = 0; i \u003C n; i\u002B\u002B)\r\n            for (int j = 0; j \u003C n; j\u002B\u002B)\r\n                matrix[i, j] = i * n \u002B j;\r\n\r\n        // Act\r\n        string result = LUPDecomposition.GetMatrix(matrix);\r\n\r\n        // Assert\r\n        string[] lines = result.Split(\u0027\\n\u0027, StringSplitOptions.RemoveEmptyEntries);\r\n        Assert.Equal(n, lines.Length);\r\n\r\n        for (int i = 0; i \u003C n; i\u002B\u002B)\r\n        {\r\n            string[] values = lines[i].Split(\u0027\\t\u0027, StringSplitOptions.RemoveEmptyEntries);\r\n            Assert.Equal(n, values.Length);\r\n\r\n            for (int j = 0; j \u003C n; j\u002B\u002B)\r\n            {\r\n                Assert.Equal((i * n \u002B j).ToString(), values[j]);\r\n            }\r\n        }\r\n    }\r\n\r\n    [Fact]\r\n    public void GetMatrix_PassingNonSquareMatrix_ReturnsCorrectStringRepresentation()\r\n    {\r\n        // Arrange\r\n        double[,] matrix = new double[,]\r\n        {\r\n            { 1, 2, 3 },\r\n            { 4, 5, 6 }\r\n        };\r\n\r\n        // Act\r\n        string result = LUPDecomposition.GetMatrix(matrix);\r\n\r\n        // Assert\r\n        string expected = \u00221\\t2\\t3\\t\\n4\\t5\\t6\\t\\n\u0022;\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Theory]\r\n    [InlineData(new int[] { 0 }, 1)]\r\n    [InlineData(new int[] { 1, 0 }, 2)]\r\n    [InlineData(new int[] { 1, 2, 0 }, 3)]\r\n    [InlineData(new int[] { 3, 2, 1, 0 }, 4)]\r\n    [InlineData(new int[] { 4, 3, 2, 1, 0 }, 5)]\r\n    public void GetPermutationMatrix_PassingValidPermutation_ReturnsCorrectStringRepresentation(int[] P, int n)\r\n    {\r\n        // Arrange\r\n        // Act\r\n        string result = LUPDecomposition.GetPermutationMatrix(P);\r\n\r\n        // Assert\r\n        string[] lines = result.Split(\u0027\\n\u0027, StringSplitOptions.RemoveEmptyEntries);\r\n        Assert.Equal(n, lines.Length);\r\n\r\n        for (int i = 0; i \u003C n; i\u002B\u002B)\r\n        {\r\n            string[] values = lines[i].Split(\u0027\\t\u0027, StringSplitOptions.RemoveEmptyEntries);\r\n            Assert.Equal(n, values.Length);\r\n\r\n            for (int j = 0; j \u003C n; j\u002B\u002B)\r\n            {\r\n                Assert.Equal(j == P[i] ? \u00221\u0022 : \u00220\u0022, values[j]);\r\n            }\r\n        }\r\n    }\r\n\r\n    [Fact]\r\n    public void GetPermutationMatrix_PassingEmptyPermutation_ThrowsArgumentException()\r\n    {\r\n        // Arrange\r\n        int[] emptyPermutation = Array.Empty\u003Cint\u003E();\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CArgumentException\u003E(() =\u003E LUPDecomposition.GetPermutationMatrix(emptyPermutation));\r\n    }\r\n}\r\n","tests":[{"id":"9ffc3959-bdf6-d42c-0102-b2955c2c4e88","name":"Glm45AirUnitTests.LUPDecompositionTests.Decompose_PassingNonSquareMatrix_ThrowsArgumentException","location":{"start":{"line":7,"column":5},"end":{"line":15,"column":6}}},{"id ithRemovedChars","location":{"start":{"line":151,"column":9},"end":{"line":162,"column":10}}}]},"D:\\Programming\\Projects\\LlmUnitTestGenerationArtifacts\\Glm45AirUnitTests\\Sample17Tests.cs":{"language":"cs","source":"using Dataset.Sample17;\r\n\r\nnamespace Glm45AirUnitTests;\r\n\r\npublic class VectorExtensionsTests\r\n{\r\n    [Fact]\r\n    public void Copy_PassingNullVector_ThrowsArgumentNullException()\r\n    {\r\n        // Arrange\r\n        double[] vector = null;\r\n\r\n        // Act\r\n        var exception = Assert.Throws\u003CArgumentNullException\u003E(() =\u003E vector.Copy());\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022vector\u0022, exception.ParamName);\r\n    }\r\n\r\n    [Fact]\r\n    public void Copy_PassingValidVector_ReturnsCopy()\r\n    {\r\n        // Arrange\r\n        var vector = new double[] { 1.0, 2.0, 3.0 };\r\n\r\n        // Act\r\n        var result = vector.Copy();\r\n\r\n        // Assert\r\n        Assert.NotSame(vector, result);\r\n        Assert.Equal(vector, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void OuterProduct_PassingNullLhs_ThrowsArgumentNullException()\r\n    {\r\n        // Arrange\r\n        double[] lhs = null;\r\n        var rhs = new double[] { 1.0 };\r\n\r\n        // Act\r\n        var exception = Assert.Throws\u003CArgumentNullException\u003E(() =\u003E lhs.OuterProduct(rhs));\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022lhs\u0022, exception.ParamName);\r\n    }\r\n\r\n    [Fact]\r\n    public void OuterProduct_PassingNullRhs_ThrowsArgumentNullException()\r\n    {\r\n        // Arrange\r\n        var lhs = new double[] { 1.0 };\r\n        double[] rhs = null;\r\n\r\n        // Act\r\n        var exception = Assert.Throws\u003CArgumentNullException\u003E(() =\u003E lhs.OuterProduct(rhs));\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022rhs\u0022, exception.ParamName);\r\n    }\r\n\r\n    [Fact]\r\n    public void OuterProduct_PassingValidVectors_ReturnsCorrectMatrix()\r\n    {\r\n        // Arrange\r\n        var lhs = new double[] { 1.0, 2.0 };\r\n        var rhs = new double[] { 3.0, 4.0 };\r\n\r\n        // Act\r\n        var result = lhs.OuterProduct(rhs);\r\n\r\n        // Assert\r\n        Assert.Equal(2, result.GetLength(0));\r\n        Assert.Equal(2, result.GetLength(1));\r\n        Assert.Equal(3.0, result[0, 0]);\r\n        Assert.Equal(4.0, result[0, 1]);\r\n        Assert.Equal(6.0, result[1, 0]);\r\n        Assert.Equal(8.0, result[1, 1]);\r\n    }\r\n\r\n    [Fact]\r\n    public void Dot_PassingNullLhs_ThrowsArgumentNullException()\r\n    {\r\n        // Arrange\r\n        double[] lhs = null;\r\n        var rhs = new double[] { 1.0 };\r\n\r\n        // Act\r\n        var exception = Assert.Throws\u003CArgumentNullException\u003E(() =\u003E lhs.Dot(rhs));\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022lhs\u0022, exception.ParamName);\r\n    }\r\n\r\n    [Fact]\r\n    public void Dot_PassingNullRhs_ThrowsArgumentNullException()\r\n    {\r\n        // Arrange\r\n        var lhs = new double[] { 1.0 };\r\n        double[] rhs = null;\r\n\r\n        // Act\r\n        var exception = Assert.Throws\u003CArgumentNullException\u003E(() =\u003E lhs.Dot(rhs));\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022rhs\u0022, exception.ParamName);\r\n    }\r\n\r\n    [Fact]\r\n    public void Dot_PassingVectorsOfDifferentLengths_ThrowsArgumentException()\r\n    {\r\n        // Arrange\r\n        var lhs = new double[] { 1.0, 2.0 };\r\n        var rhs = new double[] { 3.0 };\r\n\r\n        // Act\r\n        var exception = Assert.Throws\u003CArgumentException\u003E(() =\u003E lhs.Dot(rhs));\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022Arguments must have same dimension.\u0022, exception.Message);\r\n    }\r\n\r\n    [Theory]\r\n    [InlineData(new double[] { 1.0, 2.0, 3.0 }, new double[] { 4.0, 5.0, 6.0 }, 32.0)]\r\n    [InlineData(new double[] { -1.0, -2.0, -3.0 }, new double[] { 4.0, 5.0, 6.0 }, -32.0)]\r\n    [InlineData(new double[] { 0.0, 0.0, 0.0 }, new double[] { 4.0, 5.0, 6.0 }, 0.0)]\r\n    [InlineData(new double[] { 1.0, 1.0 }, new double[] { 1.0, 1.0 }, 2.0)]\r\n    public void Dot_PassingValidVectors_ReturnsCorrectDotProduct(double[] lhs, double[] rhs, double expected)\r\n    {\r\n        // Arrange\r\n        // Already arranged by InlineData\r\n\r\n        // Act\r\n        var result = lhs.Dot(rhs);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void Magnitude_PassingNullVector_ThrowsArgumentNullException()\r\n    {\r\n        // Arrange\r\n        double[] vector = null;\r\n\r\n        // Act\r\n        var exception = Assert.Throws\u003CArgumentNullException\u003E(() =\u003E vector.Magnitude());\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022vector\u0022, exception.ParamName);\r\n    }\r\n\r\n    [Theory]\r\n    [InlineData(new double[] { 3.0, 4.0 }, 5.0)]\r\n    [InlineData(new double[] { 2.0, 4.0, 4.0 }, 6.0)]\r\n    [InlineData(new double[] { 0.0, 0.0 }, 0.0)]\r\n    [InlineData(new double[] { -3.0, -4.0 }, 5.0)]\r\n    public void Magnitude_PassingValidVector_ReturnsCorrectMagnitude(double[] vector, double expected)\r\n    {\r\n        // Arrange\r\n        // Already arranged by InlineData\r\n\r\n        // Act\r\n        var result = vector.Magnitude();\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void Scale_PassingNullVector_ThrowsArgumentNullException()\r\n    {\r\n        // Arrange\r\n        double[] vector = null;\r\n        var factor = 2.0;\r\n\r\n        // Act\r\n        var exception = Assert.Throws\u003CArgumentNullException\u003E(() =\u003E vector.Scale(factor));\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022vector\u0022, exception.ParamName);\r\n    }\r\n\r\n    [Theory]\r\n    [InlineData(new double[] { 1.0, 2.0, 3.0 }, 2.0, new double[] { 2.0, 4.0, 6.0 })]\r\n    [InlineData(new double[] { 1.0, 2.0, 3.0 }, 0.5, new double[] { 0.5, 1.0, 1.5 })]\r\n    [InlineData(new double[] { 1.0, 2.0, 3.0 }, 0.0, new double[] { 0.0, 0.0, 0.0 })]\r\n    [InlineData(new double[] { -1.0, -2.0 }, -2.0, new double[] { 2.0, 4.0 })]\r\n    public void Scale_PassingValidVectorAndFactor_ReturnsCorrectScaledVector(double[] vector, double factor, double[] expected)\r\n    {\r\n        // Arrange\r\n        // Already arranged by InlineData\r\n\r\n        // Act\r\n        var result = vector.Scale(factor);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void ToColumnVector_PassingNullSource_ThrowsArgumentNullException()\r\n    {\r\n        // Arrange\r\n        double[] source = null;\r\n\r\n        // Act\r\n        var exception = Assert.Throws\u003CArgumentNullException\u003E(() =\u003E source.ToColumnVector());\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022source\u0022, exception.ParamName);\r\n    }\r\n\r\n    [Fact]\r\n    public void ToColumnVector_PassingValidVector_ReturnsCorrectColumnVector()\r\n    {\r\n        // Arrange\r\n        var source = new double[] { 1.0, 2.0, 3.0 };\r\n\r\n        // Act\r\n        var result = source.ToColumnVector();\r\n\r\n        // Assert\r\n        Assert.Equal(3, result.GetLength(0));\r\n        Assert.Equal(1, result.GetLength(1));\r\n        Assert.Equal(1.0, result[0, 0]);\r\n        Assert.Equal(2.0, result[1, 0]);\r\n        Assert.Equal(3.0, result[2, 0]);\r\n    }\r\n\r\n    [Fact]\r\n    public void ToRowVector_PassingNullSource_ThrowsArgumentNullException()\r\n    {\r\n        // Arrange\r\n        double[,] source = null;\r\n\r\n        // Act\r\n        var exception = Assert.Throws\u003CArgumentNullException\u003E(() =\u003E source.ToRowVector());\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022source\u0022, exception.ParamName);\r\n    }\r\n\r\n    [Fact]\r\n    public void ToRowVector_PassingMatrixWithWidthNotEqualTo1_ThrowsInvalidOperationException 2, 5, \u0022Btwqi\u0022)]\r\n    [InlineData(\u0022Programming\u0022, 13, \u0022Cebtenzzvat\u0022)]\r\n    [InlineData(\u0022XYZ\u0022, 5, \u0022CDE\u0022)]\r\n    [InlineData(\u0022abc\u0022, 30, \u0022efg\u0022)]\r\n    [InlineData(\u0022ABC\u0022, -1, \u0022ZAB\u0022)]\r\n    [InlineData(\u0022abc\u0022, -3, \u0022xyz\u0022)]\r\n    public void Encode_PassingAlphabeticTextAndKey_ReturnsEncodedText(string text, int key, string expectedResult)\r\n    {\r\n        // Arrange\r\n        // Act\r\n        var result = CaesarEncoder.Encode(text, key);\r\n\r\n        // Assert\r\n        Assert.Equal(expectedResult, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void Decode_PassingNullText_ThrowsArgumentNullException()\r\n    {\r\n        // Arrange\r\n        string text = null;\r\n        int key = 1;\r\n\r\n        // Act\r\n        var exception = Assert.Throws\u003CArgumentNullException\u003E(() =\u003E CaesarEncoder.Decode(text, key));\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022text\u0022, exception.ParamName);\r\n    }\r\n\r\n    [Theory]\r\n    [InlineData(\u0022\u0022)]\r\n    [InlineData(\u0022 \u0022)]\r\n    [InlineData(\u0022123\u0022)]\r\n    [InlineData(\u0022!@#\u0022)]\r\n    public void Decode_PassingNonAlphabeticText_ReturnsSameText(string text)\r\n    {\r\n        // Arrange\r\n        int key = 1;\r\n\r\n        // Act\r\n        var result = CaesarEncoder.Decode(text, key);\r\n\r\n        // Assert\r\n        Assert.Equal(text, result);\r\n    }\r\n\r\n    [Theory]\r\n    [InlineData(\u0022B\u0022, 1, \u0022A\u0022)]\r\n    [InlineData(\u0022b\u0022, 1, \u0022a\u0022)]\r\n    [InlineData(\u0022A\u0022, 1, \u0022Z\u0022)]\r\n    [InlineData(\u0022a\u0022, 1, \u0022z\u0022)]\r\n    [InlineData(\u0022Khoor\u0022, 3, \u0022Hello\u0022)]\r\n    [InlineData(\u0022Btwqi\u0022, 5, \u0022World\u0022)]\r\n    [InlineData(\u0022Cebtenzzvat\u0022, 13, \u0022Programming\u0022)]\r\n    [InlineData(\u0022CDE\u0022, 5, \u0022XYZ\u0022)]\r\n    [InlineData(\u0022efg\u0022, 30, \u0022abc\u0022)]\r\n    [InlineData(\u0022ZAB\u0022, -1, \u0022ABC\u0022)]\r\n    [InlineData(\u0022xyz\u0022, -3, \u0022abc\u0022)]\r\n    public void Decode_PassingAlphabeticTextAndKey_ReturnsDecodedText(string text, int key, string expectedResult)\r\n    {\r\n        // Arrange\r\n        // Act\r\n        var result = CaesarEncoder.Decode(text, key);\r\n\r\n        // Assert\r\n        Assert.Equal(expectedResult, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void EncodeAndDecode_AreInverseOperations()\r\n    {\r\n        // Arrange\r\n        string originalText = \u0022This is a test string for the Caesar cipher.\u0022;\r\n        int key = 7;\r\n\r\n        // Act\r\n        string encodedText = CaesarEncoder.Encode(originalText, key);\r\n        string decodedText = CaesarEncoder.Decode(encodedText, key);\r\n\r\n        // Assert\r\n        Assert.Equal(originalText, decodedText);\r\n    }\r\n}\r\n","tests":[{"id":"ae44591b-6443-e712-da10-0873c7434502","name":"Glm45AirUnitTests.CaesarEncoderTests.Encode_PassingNullText_ThrowsArgumentNullException","location":{"start":{"line":7,"column":5},"end":{"line":19,"column":6}}},{"id":"9a78eae4-6871-e62b-e2ab-7fca50e10f77","name":"Glm45AirUnitTests.CaesarEncoderTests.Encode_PassingNonAlphabeticText_ReturnsSameText","location":{"start":{"line":21,"column":5},"end":{"line":36,"column":6}}},{"id":"05280759-7abb-3164-c9d6-2981da1c471f","name":"Glm45AirUnitTests.CaesarEncoderTests.Encode_PassingNonAlphabeticText_ReturnsSameText","location":{"start":{"line":21,"column":5},"end":{"line":36,"column":6}}},{"id":"211113eb-b2d9-9913-3753-d420a8d55d18","name":"Glm45AirUnitTests.CaesarEncoderTests.Encode_PassingNonAlphabeticText_ReturnsSameText","location":{"start":{"line":21,"column":5},"end":{"line":36,"column":6}}},{"id":"69a34535-e04f-52fc-3dbf-11f463b35890","name":"Glm45AirUnitTests.CaesarEncoderTests.Encode_PassingNonAlphabeticText_ReturnsSameText","location":{"start":{"line":21,"column":5}," \r\n            Assert.Null(result.ParentId);\r\n            Assert.Single(result.SubFolders);\r\n            Assert.Equal(\u0022SubFolder1\u0022, result.SubFolders.First().Name);\r\n            _folderRepositorySubstitute.Received(1).GetRootFoldersAsync();\r\n        }\r\n\r\n        [Fact]\r\n        public async Task GivenSingleLevelPath_WhenFolderExists_ThenReturnsFolder()\r\n        {\r\n            // Arrange\r\n            var folderName = \u0022ExistingFolder\u0022;\r\n            var folderEntity = new FolderEntity { Id = 1, Name = folderName, ParentId = null, SubFolders = new List\u003CFolderEntity\u003E() };\r\n            _folderRepositorySubstitute.GetFolderByNameAsync(folderName).Returns(folderEntity);\r\n\r\n            // Act\r\n            var result = await _folderService.GetFolderAsync($\u0022/{folderName}/\u0022);\r\n\r\n            // Assert\r\n            Assert.NotNull(result);\r\n            Assert.Equal(folderEntity.Id, result.Id);\r\n            Assert.Equal(folderEntity.Name, result.Name);\r\n            Assert.Equal(folderEntity.ParentId, result.ParentId);\r\n            Assert.Empty(result.SubFolders);\r\n            _folderRepositorySubstitute.Received(1).GetFolderByNameAsync(folderName);\r\n        }\r\n\r\n        [Fact]\r\n        public async Task GivenSingleLevelPath_WhenFolderDoesNotExist_ThenThrowsFolderNotFoundException()\r\n        {\r\n            // Arrange\r\n            var folderName = \u0022NonExistingFolder\u0022;\r\n            _folderRepositorySubstitute.GetFolderByNameAsync(folderName).Returns((FolderEntity?)null);\r\n\r\n            // Act \u0026 Assert\r\n            var exception = await Assert.ThrowsAsync\u003CFolderNotFoundException\u003E(() =\u003E _folderService.GetFolderAsync(folderName));\r\n            Assert.Contains($\u0022Folder \u0060{folderName}\u0060 does not exist.\u0022, exception.Message);\r\n            _folderRepositorySubstitute.Received(1).GetFolderByNameAsync(folderName);\r\n        }\r\n\r\n ();\r\n            var sourceMatrix = CreateSquareMatrix(size);\r\n\r\n            // Act\r\n            var result = lu.Decompose(sourceMatrix);\r\n\r\n            // Assert\r\n            Assert.NotNull(result.L);\r\n            Assert.NotNull(result.U);\r\n            Assert.Equal(size, result.L.GetLength(0));\r\n            Assert.Equal(size, result.L.GetLength(1));\r\n            Assert.Equal(size, result.U.GetLength(0));\r\n            Assert.Equal(size, result.U.GetLength(1));\r\n            Assert.Equal(1, result.L[0, 0]);\r\n            Assert.Equal(1, result.L[1, 1]);\r\n            Assert.Equal(1, result.L[size - 1, size - 1]);\r\n        }\r\n\r\n        [Fact]\r\n        public void Decompose_IdentityMatrix_ReturnsLUAsIdentityMatrices()\r\n        {\r\n            // Arrange\r\n            var lu = new Lu();\r\n            var identityMatrix = new double[,] { { 1, 0 }, { 0, 1 } };\r\n\r\n            // Act\r\n            var result = lu.Decompose(identityMatrix);\r\n\r\n            // Assert\r\n            Assert.Equal(identityMatrix, result.L);\r\n            Assert.Equal(identityMatrix, result.U);\r\n        }\r\n\r\n        private static double[,] CreateSquareMatrix(int size)\r\n        {\r\n            var matrix = new double[size, size];\r\n            for (var i = 0; i \u003C size; i\u002B\u002B)\r\n            {\r\n                for (var j = 0; j \u003C size; j\u002B\u002B)\r\n                {\r\n                    matrix[i, j] = i * size \u002B j \u002B 1;\r\n                }\r\n            }\r\n            return matrix;\r\n        }\r\n    }\r\n\r\n    public class EliminateTests\r\n    {\r\n        [Fact]\r\n        public void Eliminate_NonSquareMatrix_ThrowsArgumentException()\r\n        {\r\n            // Arrange\r\n            var lu = new Lu();\r\n            var nonSquareMatrix = new double[,] { { 1, 2 }, { 3, 4 }, { 5, 6 } };\r\n            var coefficients = new double[] { 1, 2, 3 };\r\n\r\n            // Act\r\n            var
